INSERT INTO `zj_news` VALUES (17, 2, '一个中国人是怎么登上巅峰的？', 'http://jianzhi.hmdog.com/upload/20190623/d99f936387db2340c549adcd0936386b.jpg', '新闻简介新闻简介新闻简介新闻简介新闻简介新闻简介', '<p>假如你身边有这么一个人：</p><p><br></p><p>1. 成就和贡献极大：不仅是第一个获得诺贝尔奖的华人，还是二战后全世界最伟大的科学家；</p><p><br></p><p>2. 非议和责骂极多：关于他的婚姻、国籍……几十年来非议从没断过。</p><p><br></p><p>你会怎么对他呢？</p><p><br></p><p>这不是一个故弄玄虚的思想实验，因为这个人就生活在我们身边。他和我们同为华人，而且还生活在同一时代。</p><p><br></p><p>没错，估计你已经猜到了，这个人就是——杨振宁。</p><p><br></p><p><br></p><p><br></p><p>网上关于杨振宁的传闻到处都是，但毫不夸张地说：大部分的言论都是错的，不仅曲解了杨振宁，也深深地误导了我们。</p><p><br></p><p>有没有人能澄清误读、还原争议，正本清源地讲一讲杨振宁？</p><p><br></p><p>有。</p><p><br></p><p>今天得到App上线了一门新课——《科学人物课：杨振宁》。作为「得到」的“科学人物第一课”，强烈建议你马上学习。</p><p><br></p><p>▽ 戳此学习</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>为什么要了解杨振宁</p><p><br></p><p>给你三个理由：</p><p><br></p><p>1. 杨振宁是二战后全世界最伟大的科学家。</p><p><br></p><p>简单给你看两个数字：先后有7个诺贝尔奖，是直接利用杨振宁提出的“杨-米尔斯方程”拿到的；还有几十个诺贝尔奖，和杨振宁提出的理论有关。</p><p><br></p><p>不是每代人都有机会和这样一位伟大的科学家，生活在同一时代。能和杨振宁生活在同一时代，是我们这代人的幸运。这种幸运，当然不应该被忽视和辜负。</p><p><br></p><p><br></p><p><br></p><p>2.杨振宁这样一位伟大的科学家，却被严重低估和误读了。</p><p><br></p><p>对于杨振宁，大多数人关注的焦点无外乎三点：①他和翁帆年龄相差54岁的婚姻；②他晚年回到清华，还恢复了中国国籍；③他极力反对中国建造高能加速器。</p><p><br></p><p>这些和杨振宁的物理学成就没有任何关系，而是纠结于他的生活隐私和花边八卦，更何况这些内容也并不真实。对当今世界上最伟大的科学家有这样的错误评价，实在太不应该了，每个中国人都有必要重新理解杨振宁。</p><p><br></p><p><br></p><p><br></p><p>3. 杨振宁成就自己的方式非常独特，非常有借鉴意义。</p><p><br></p><p>1922年杨振宁出生时，持续了20多年的物理学“黄金年代”已经到达顶峰；当他开始做科研时，黄金年代的大潮已经褪去。杨振宁的伟大之处，就在于错过了最大风口，却仍然做出非凡成就。以一个中国人的身份，第一次登上了世界科学之巅。时至今日，他依然是中国人触达过的最高高度。</p><p><br></p><p>杨振宁是如何突破障碍、成就自我的？他的成功源于做对了什么选择，避开了哪些陷阱？这些自我成就的细节，对我们每个人都有莫大的借鉴意义。</p>', 10, '2019-06-23 00:58:32', '2019-06-23 20:05:23', 0);
